script: |
  super -f text -I q2933.spq | sort > q2933.out

inputs:
  - name: q2933.spq
    data: |
      SELECT - ( ( - 70 ) ) AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT ( NOT ( NOT + 65 * 21 BETWEEN 97 - + col1 AND ( - 38 + 38 ) ) );
  - name: tab1

outputs:
  - name: q2933.out
    data: |
      70
      70
      70
